import { Link } from "react-router-dom";
import {JSX} from 'react'

export default function NavBar(): JSX.Element {
  return (
    <nav>
      <div>
        {/* Use <img> instead of <Image> */}
        <img src="blog.png" alt="logo" width="60" height="40" />

        <div>
          <button>
            <Link to="/">Posts</Link>
          </button>
          <button>
            <Link to="/create">Create new</Link>
          </button>
        </div>
      </div>
    </nav>
  );
}
